choices.text:
parseArray(parser, componentType, array, fieldName);
if (componentClass == byte.class) {
    byte[] bytes = new byte[array.size()];
    for (int i = 0; i < array.size(); ++i) {
        Object val = array.get(i);
        if (val == null) {
            bytes[i] = 0;
        } else {
            bytes[i] = TypeUtils.castToByte(val);
        }
    }
    return (T) bytes;
}

parser.parseArray(componentType, array, fieldName);
if (componentClass == byte.class) {
    return (T) array.toArray();
}
Object[] objectArray = (Object[]) Array.newInstance(componentClass, array.size());
array.toArray(objectArray);

parser.parseArray(componentType, array, fieldName);
int size = array.size();
Object list = Array.newInstance(componentClass, size);
for (int i = 0; i < size; ++i) {
    Object value = array.get(i);
    if (value == array) {
        Array.set(list, i, list);
    } else {
        Array.set(list, i, value);
    }
}

